import './Card.css';
import ReturnIconCard from './Icon';
// Icon and text view
import { IoIosPeople, IoIosPhonePortrait, IoIosWallet } from 'react-icons/io';
import Media from 'react-media';

// CaRd Main 
export default function ReturnCaRd() {
 return (
  <div className='wrp-card-homed'>
   <div className='wrp-subcard-homed'>
    <ReturnIconCard icon={<IoIosPeople size={'2em'} />} Text={'This People Icon'} />
    <ReturnIconCard icon={<IoIosPhonePortrait size={'2em'} />} Text={'This People Icon'} />
    <ReturnIconCard icon={<IoIosWallet size={'2em'} />} Text={'This People Icon'} />
   </div>

  </div>
 );
};
